```
#include <string>
#include <iostream>
#include <html/html.h>

std::string convert_markdown_to_html(const std::string& markdown) {
    // Create a new string to store the HTML output
    std::string html = "";

    // Iterate through each character in the markdown string
    for (char c : markdown) {
        // Check if the character is a markdown special character
        if (is_markdown_special_char(c)) {
            // If it is, replace it with the corresponding HTML character
            html += "<span class=\"" + get_markdown_special_char_class(c) + "\">" + c + "</span>";
        } else {
            // If it isn't, just add it to the HTML string as-is
            html += c;
        }
    }

    // Return the HTML string
    return html;
}

// Helper function to check if a character is a markdown special character
bool is_markdown_special_char(char c) {
    // Define a list of markdown special characters
    const std::string special_chars = "!*~:;><?";

    // Check if the character is in the list
    return (special_chars.find(c) != std::string::npos);
}

// Helper function to get the class name for a markdown special character
std::string get_markdown_special_char_class(char c) {
    // Define a list of class names for markdown special characters
    const std::string classes = "special";

    // Check if the character is a number
    if (is_number(c)) {
        return classes + "_number";
    }

    // Check if the character is a symbol
    if (is_symbol(c)) {
        return classes + "_symbol";
    }

    // If the character isn't a number or symbol, just return the default class name
    return classes;
}

// Helper function to check if a character is a number
bool is_number(char c) {
    // Define a list of number characters
    const std::string numbers = "0123456789";

    // Check if the character is in the list
    return (numbers.find(c) != std::string::npos);
}

// Helper function to check if a character is a symbol
bool is_symbol(char c) {
    // Define a list of symbol characters
    const std::string symbols = "!@#$%^&*()_+-=[]{}|;:,.<>?";

    // Check if the character is in the list
    return (symbols.find(c) != std::string::npos);
}
```
This function takes a reference to a `std::string` containing markdown formatted text and returns a `std::string` containing HTML formatted text. It does this by iterating through each character in the markdown string and checking if it is a markdown special character. If it is, it replaces it with the corresponding HTML character and adds it to the HTML string. If it isn't, it just adds it to the HTML string as-is. The function uses a series of helper functions to check if a character is a markdown special character, a number, or a symbol, and to get the class name for a markdown special character.

