```
#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>

#define WINDOW_WIDTH 640
#define WINDOW_HEIGHT 480
#define CELL_SIZE 20
#define SNAKE_IMAGE_FILE "snake.png"

typedef struct {
    int x;
    int y;
} Cell;

typedef struct {
    Cell head;
    Cell body[5];
} Snake;

typedef struct {
    Snake snake;
    Cell food;
    Cell walls[4];
} GameState;

void draw_snake(Snake snake, int x, int y);
void draw_food(Cell food);
void draw_walls(Cell walls[4]);

void move_snake(Snake snake);
void grow_snake(Snake snake);
void shrink_snake(Snake snake);
void change_direction(Snake snake);

void update_food(GameState game_state);
void update_walls(GameState game_state);

void game_loop(GameState game_state);

int main() {
    // Load the snake image
    Snake snake = { 0, { CELL_SIZE, CELL_SIZE } };
    int snake_image_width = 0;
    int snake_image_height = 0;
    FILE *image_file = fopen(SNAKE_IMAGE_FILE, "rb");
    if (image_file) {
        fread(&snake_image_width, sizeof(int), 1, image_file);
        fread(&snake_image_height, sizeof(int), 1, image_file);
        fread(&snake.head.x, sizeof(int), 1, image_file);
        fread(&snake.head.y, sizeof(int), 1, image_file);
        fread(&snake.body[0].x, sizeof(int), 1, image_file);
        fread(&snake.body[0].y, sizeof(int), 1, image_file);
        fread(&snake.body[1].x, sizeof(int), 1, image_file);
        fread(&snake.body[1].y, sizeof(int), 1, image_file);
        fread(&snake.body[2].x, sizeof(int), 1, image_file);
        fread(&snake.body[2].y, sizeof(int), 1, image_file);
        fread(&snake.body[3].x, sizeof(int), 1, image_file);
        fread(&snake.body[3].y, sizeof(int), 1, image_file);
        fclose(image_file);
    }

    // Initialize the game state
    GameState game_state = {
        .snake = snake,
        .food = { 0, { CELL_SIZE, CELL_SIZE } },
        .walls = {
            { 0, 0 },
            { WINDOW_WIDTH - CELL_SIZE, 0 },
            { WINDOW_WIDTH - CELL_SIZE, WINDOW_HEIGHT - CELL_SIZE },
            { 0, WINDOW_HEIGHT - CELL_SIZE }
        }
    };

    // Main game loop
    while (true) {
        game_loop(game_state);
    }

    return 0;
