  png_structp png = png_create_file(&pngFile);
  png_infop info = png_create_info_struct(png);
  png_set_error_fn(png, error_fn);
  png_set_progressive_mode(png, PNG_PROGRESSIVE_YES);
  png_set_sig_bytes(png, 0);
  png_set_strip_to_memory(png, 1);
  png_set_read_fn(png, read_png_data);
