}

// Display the snake image on the screen
void displaySnakeImage(void) {
  int i, j;
  for (i = 0; i < SCREEN_WIDTH; i++) {
    for (j = 0; j < SCREEN_HEIGHT; j++) {
      screen[i][j] = snake[SNAKE_TAIL - 1];
    }
  }
}

// Handle the snake's movement
void handleSnakeMovement(void) {
  int i;
  int newX, newY;
  // Move the snake's head
  if (snake[SNAKE_HEAD - 1] == 0) {
    newX = headX + SNAKE_SPEED;
    newY = headY - SNAKE_SPEED;
    if (newX < 0 || newX >= SCREEN_WIDTH || newY < 0 || newY >= SCREEN_HEIGHT) {
      gameEnd = 1;
      return;
    }
    headX = newX;
    headY = newY;
  }
  // Move the snake's tail
  else {
    newX = tailX - SNAKE_SPEED;
    newY = tailY - SNAKE_SPEED;
    if (newX < 0 || newX >= SCREEN_WIDTH || newY < 0 || newY >= SCREEN_HEIGHT) {
      gameEnd = 1;
      return;
    }
    if (newX == tailX && newY == tailY) {
      // Check for collision with the screen edges
      if (newX == 0 || newX == SCREEN_WIDTH - 1 || newY == 0 || newY == SCREEN_HEIGHT - 1) {
        gameEnd = 1;
        return;
      }
    }
    else {
      // Move the snake's body
      for (i = SNAKE_TAIL - 2; i >= 0; i--) {
        if (snake[i] == 0) {
          break;
        }
        newX = tailX - SNAKE_SPEED;
        newY = tailY - SNAKE_SPEED;
        if (newX < 0 || newX >= SCREEN_WIDTH || newY < 0 || newY >= SCREEN_HEIGHT) {
          gameEnd = 1;
          return;
        }
        if (newX == tailX && newY == tailY) {
          // Check for collision with the screen edges
          if (newX == 0 || newX == SCREEN_WIDTH - 1 || newY == 0 || newY == SCREEN_HEIGHT - 1) {
            gameEnd = 1;
            return;
          }
        }
        else {
          // Move the snake's body
          snake[i] = snake[i + 1];
        }
      }
    }
  }
}

// Handle the snake's death and respawn
void handleSnakeDeath(void) {
  if (gameEnd == 1) {
    return;
  }
  // Respawn the snake
  snake[SNAKE_HEAD - 1] = 1;
  snake[SNAKE_TAIL - 1] = 0;
  tailX = (headX + SCREEN_WIDTH) / 2;
  tailY = (headY + SCREEN_HEIGHT) / 2;
  headX = (tailX + SCREEN_WIDTH) / 2;
  headY = (tailY + SCREEN_HEIGHT) / 2;
  // Display the updated snake image
  displaySnakeImage();
}

