In TypeScript, you can use the `as` keyword to assert a type that you know is valid for a value, even if the value could have multiple types. For example, if you have a function that takes an optional `arg1` parameter, you can assert that it will only be `string` like this:
```
function myFunction(arg1: string) {
  // do something with arg1
}

myFunction("hello"); // this is valid
myFunction(123); // this is an error
```
Alternatively, you can use the `typeof` operator to assert the type of a value. For example, if you have a variable that could be either a string or a number, you can assert that it is a string like this:
```
let myVar: string | number = "hello";

myVar = 42; // this is an error

// assert that myVar is a string
myVar = "hello" as string;
```
It's important to note that these assertions are not part of the type system, but rather a way to provide additional information to the TypeScript compiler. If the assertions are not true, the compiler will not catch the error, but if the assertions are not true, the code will not work as expected.

