Here is a Python function that can be used to determine whether a number is prime:
```python
def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True
```
This function takes an integer `n` as input and returns `True` if it is prime, and `False` otherwise. It works by checking if `n` is less than or equal to 1, and if it is, it returns `False`. If `n` is greater than 1, it checks if `n` is divisible by any number between 2 and the square root of `n`. If `n` is divisible by any of these numbers, it returns `False`. If `n` is not divisible by any of these numbers, it returns `True`.

